import React, { useState } from 'react';
import Form from './Form';

function App() {
  fetch(
    'api.openweathermap.org/data/2.5/weather?q={Philadelphia}&appid={09cb87e3b19945bb6949563cd21ace23}'
  )
    .then((res) => res.json())
    .then((result) => console.log(result));
  return <Form />;
}

export default App;
